    "number_abs": null,
    "overview": "The Tenth Doctor (David Tennant) lies on the TARDIS floor composing a symphony whilst listening to the \"Music of the Spheres\" - the Universe's gravity patterns fed through the TARDIS harmonic filter producing a musical sound. The Graske (Jimmy Vee) teleports into the TARDIS to warn the Doctor about a space portal that promptly opens in the TARDIS linking it to the Royal Albert Hall during a Proms concert. The Doctor converses with the audience revealing that he played the tuba at the very first Proms, making a joke about Beethoven's deafness and implying that he has met him. The Doctor sends his own sheet music through the portal to the orchestra to have his symphony, Ode to the Universe, played by them. As the orchestra plays the Doctor's symphony conducted by the Doctor himself with his sonic screwdriver, the Graske steals the Doctor's water pistol and uses the portal to get to Earth. The Graske sprays some of the audience in the Royal Albert Hall with water before being pulled back through the portal by the Doctor who reversed the polarity of the neutron flow. The Doctor reverses the teleport and sends the Graske to the other side of the galaxy. The Doctor tells the audience to listen out for the \"Music of the Spheres\" that is all around them before returning to the TARDIS console to close the portal.",
